/* Structure for the `ACTIONS_REG` table :  */

CREATE TABLE ACTIONS_REG (
  ACTIONS_ID INTEGER NOT NULL,
  ACTOR_ID INTEGER,
  SERVICE_ID INTEGER,
  REPORT_ID INTEGER,
  A_TSTAMP TIMESTAMP DEFAULT 'NOW' NOT NULL,
  DOC_ID INTEGER,
  ATYPE_ID SMALLINT NOT NULL,
  PERSON_ID INTEGER,
  SERVICE_GROUP_ID INTEGER,
  CLOSED SMALLINT DEFAULT 0 NOT NULL);


ALTER TABLE ACTIONS_REG ADD PRIMARY KEY (ACTIONS_ID);

/* Structure for the `ACTION_TYPES` table :  */

CREATE TABLE ACTION_TYPES (
  ACTION_TYPE_ID INTEGER NOT NULL,
  ACTION_TYPE_NAME VARCHAR(255) CHARACTER SET UTF8 NOT NULL COLLATE UTF8,
  ACTION_TYPE_INT_CODE INTEGER NOT NULL);


ALTER TABLE ACTION_TYPES ADD PRIMARY KEY (ACTION_TYPE_ID);

ALTER TABLE ACTION_TYPES ADD CONSTRAINT UQ_ACTION_TYPES UNIQUE (ACTION_TYPE_INT_CODE);

/* Structure for the `REPORTS` table :  */

CREATE TABLE REPORTS (
  REPORT_ID INTEGER NOT NULL,
  REPORT_NAME VARCHAR(255) CHARACTER SET UTF8 NOT NULL COLLATE UTF8,
  REPORT_INT_CODE INTEGER NOT NULL,
  PREVIEW_COUNTER INTEGER DEFAULT 0 NOT NULL,
  PRINT_COUNTER INTEGER DEFAULT 0 NOT NULL,
  DEFAULT_PRINTER VARCHAR(255) CHARACTER SET UTF8 DEFAULT 'DEFAULT_PRINTER' NOT NULL COLLATE UTF8);


ALTER TABLE REPORTS ADD PRIMARY KEY (REPORT_ID);

ALTER TABLE REPORTS ADD CONSTRAINT UQ_REPORTS UNIQUE (REPORT_INT_CODE);

/* Definition for the `ACTION_REG_VIEW` view :  */

CREATE VIEW ACTION_REG_VIEW(
  ATYPE_ID,
  ACTOR_ID,
  PERSON_ID,
  AT_NAME,
  A_TSTAMP,
  REPORT_NAME)
AS
select ar.ATYPE_ID, ar.ACTOR_ID, AR.PERSON_ID, 
atp.ACTION_TYPE_NAME as AT_NAME, ar.A_TSTAMP,
rp.REPORT_NAME 
from ACTIONS_REG ar LEFT JOIN ACTION_TYPES atp 
ON (ar.ATYPE_ID=atp.ACTION_TYPE_ID) 
LEFT JOIN REPORTS rp ON (ar.REPORT_ID=rp.REPORT_ID);

