/* Definition for the `ADD_UPDATE_COUNTRY_EXT` procedure :  */

SET TERM ^ ;

CREATE PROCEDURE ADD_UPDATE_COUNTRY_EXT(
  IN_COUNTRY_ID INTEGER,
  IN_COUNTRY_NAME VARCHAR(255) CHARACTER SET NONE COLLATE NONE,
  IN_COUNTRY_CODE INTEGER,
  IN_KLADR_SHORTY VARCHAR(50) CHARACTER SET UTF8 COLLATE UTF8,
  IN_KLADR_CODE VARCHAR(20) CHARACTER SET UTF8 COLLATE UTF8,
  IN_KLADR_INDEX VARCHAR(10) CHARACTER SET UTF8 COLLATE UTF8,
  IN_KLADR_GNIMB VARCHAR(5) CHARACTER SET UTF8 COLLATE UTF8,
  IN_KLADR_UNO VARCHAR(20) CHARACTER SET UTF8 COLLATE UTF8,
  IN_KLADR_OCATD VARCHAR(15) CHARACTER SET UTF8 COLLATE UTF8,
  IN_KLADR_STATUS VARCHAR(20) CHARACTER SET UTF8 COLLATE UTF8)
RETURNS(
  OUT_COUNTRY_ID INTEGER)
AS
BEGIN
  /* Procedure body */
  IF (IN_COUNTRY_ID IS NULL) THEN
  BEGIN
  	OUT_COUNTRY_ID = GEN_ID(COUNTRIES_COUNTRY_ID_GEN, 1);
    
    IF (IN_COUNTRY_CODE IS NULL) THEN
    BEGIN
    	SELECT COUNT(*) FROM COUNTRIES INTO :IN_COUNTRY_CODE;
        IF (IN_COUNTRY_CODE=0) THEN
        BEGIN
        	IN_COUNTRY_CODE=1;
        END
        ELSE
        BEGIN
        	SELECT MAX(COUNTRY_INT_CODE)+1 FROM COUNTRIES 
            INTO :IN_COUNTRY_CODE;	
        END
    END
    
  	INSERT INTO COUNTRIES(COUNTRY_ID, COUNTRY_NAME, COUNTRY_INT_CODE,
    KLADR_SHORTY, KLADR_CODE, KLADR_INDEX, KLADR_GNIMB, KLADR_UNO,
    KLADR_OCATD, KLADR_STATUS)
    VALUES (:OUT_COUNTRY_ID, :IN_COUNTRY_NAME, :IN_COUNTRY_CODE,
    :IN_KLADR_SHORTY, :IN_KLADR_CODE, :IN_KLADR_INDEX, :IN_KLADR_GNIMB,
    :IN_KLADR_UNO, :IN_KLADR_OCATD, :IN_KLADR_STATUS);
    
    WHEN ANY DO
  		OUT_COUNTRY_ID=NULL;
  END
  SUSPEND;
END^

SET TERM ; ^

