CREATE PROCEDURE ADD_UPDATE_ELINK(
  IN_ELINK_ID INTEGER,
  IN_ELINK_NAME VARCHAR(255) CHARACTER SET UTF8 COLLATE UTF8,
  IN_ELINK_TYPE INTEGER,
  IN_ELINK_CODE INTEGER)
RETURNS(
  OUT_ELINK_ID INTEGER)
AS
BEGIN
  /* Procedure body */
  IF (IN_ELINK_ID IS NULL) THEN
  BEGIN
  
  	IF (IN_ELINK_CODE IS NULL) THEN
    BEGIN
    	SELECT COALESCE(MAX(ELINK_CODE),0)+1 FROM ENTLINKS
        INTO :IN_ELINK_CODE;
    END
  
    OUT_ELINK_ID = GEN_ID(ENTLINKS_ELINK_ID_GEN, 1);
    INSERT INTO ENTLINKS(ELINK_ID, ELINK_NAME, ELINK_CODE,
    ELINK_LEVEL, ELINK_TYPE, ACT_GROUP_CODE) 
    VALUES(:OUT_ELINK_ID, :IN_ELINK_NAME, :IN_ELINK_CODE,
    1, :IN_ELINK_TYPE, 1);
  	WHEN ANY DO
  		OUT_ELINK_ID=NULL;
  END
  SUSPEND;
END^

