CREATE PROCEDURE ADD_UPDATE_REGION(
  IN_REGION_ID INTEGER,
  IN_REGION_NAME VARCHAR(255) CHARACTER SET UTF8 NOT NULL COLLATE UTF8,
  IN_IS_RCENTER SMALLINT NOT NULL,
  IN_IS_BTHREGION SMALLINT NOT NULL,
  IN_REGION_INT_CODE INTEGER)
RETURNS(
  OUT_REGION_ID INTEGER)
AS
BEGIN
  /* Procedure body */
  IF (IN_REGION_ID IS NULL) THEN
  BEGIN
  
  	IF (IN_REGION_INT_CODE IS NULL) THEN
    BEGIN
    	SELECT COUNT(*) FROM REGIONS INTO :IN_REGION_INT_CODE;
        IF (IN_REGION_INT_CODE=0) THEN
        BEGIN
        	IN_REGION_INT_CODE=1;
        END
        ELSE
        BEGIN
        	SELECT MAX(REGION_INT_CODE)+1 FROM REGIONS 
            INTO :IN_REGION_INT_CODE;	
        END
    END
  
  	OUT_REGION_ID = GEN_ID(REGIONS_REGION_ID_GEN, 1);
  	INSERT INTO REGIONS(REGION_ID, REGION_NAME, REGION_INT_CODE,
    IS_RCENTER, IS_BTHREGION)
    VALUES (:OUT_REGION_ID, :IN_REGION_NAME, :IN_REGION_INT_CODE,
    :IN_IS_RCENTER, :IN_IS_BTHREGION);
    
    WHEN ANY DO
  		OUT_REGION_ID=NULL;
  END
  SUSPEND;
END^

