    WHERE ACTIONS_ID=:IN_ACT_REG_ID 
    INTO :ACT_SERVICE_ID, :CURR_PERS_ID;
    IF (NOT(ACT_SERVICE_ID IS NULL)) THEN
    BEGIN
    FOR SELECT ael.AEL_LINK_TYPE_ID, eln.ELINK_CODE, ELN.ELINK_TYPE 
    	FROM AEL_ASSOC AEL, ENTLINKS eln
    	WHERE (ael.SERVICE_ID=:ACT_SERVICE_ID) AND (ael.ELINK_ID IS NULL) 
        AND NOT (ael.AEL_LINK_TYPE_ID IS NULL) 
        AND (ael.AEL_LINK_TYPE_ID=eln.ELINK_ID)
        INTO :CURR_AEL_LTYPE_ID, :ASSOC_ETYPE_CODE, :ASSOC_ETYPE_TYPE 
        DO
        BEGIN
            OP_PERSON_ID=:CURR_PERS_ID;
            IF (ASSOC_ETYPE_CODE<>5) THEN
            BEGIN
            	OP_PERSON_ID=NULL;
            END
        	EXECUTE PROCEDURE ADD_UPD_AEL_ASSOC(NULL, :IN_ACT_REG_ID,
            :OP_PERSON_ID, :CURR_AEL_LTYPE_ID, NULL, NULL, NULL) 
            RETURNING_VALUES (:NEW_AEL_ASSOC);
        END
    END
  END
  SUSPEND;
END^

