/* Definition for the `ADD_UPD_ACTION_REG` procedure :  */

SET TERM ^ ;

CREATE PROCEDURE ADD_UPD_ACTION_REG(
  IN_ACTION_ID INTEGER,
  IN_USER_ID INTEGER,
  IN_ATYPE_ID INTEGER,
  IN_ATSTAMP TIMESTAMP,
  IN_SERVICE_ID INTEGER,
  IN_REPORT_ID INTEGER,
  IN_DOC_ID INTEGER,
  IN_ATYPE_CODE INTEGER,
  IN_SERVICE_CODE INTEGER,
  IN_REPORT_CODE INTEGER,
  IN_USER_LOGIN VARCHAR(100) CHARACTER SET UTF8 COLLATE UTF8,
  IN_PERSON_ID INTEGER,
  IN_SERVICE_GROUP_ID INTEGER)
RETURNS(
  OUT_ACTION_ID SMALLINT)
AS
BEGIN
  /* Procedure body */
  IF (IN_ACTION_ID IS NULL) THEN
  BEGIN
  
  	IF ((IN_USER_ID IS NULL) AND NOT (IN_USER_LOGIN IS NULL)) THEN 
    BEGIN
    	EXECUTE PROCEDURE GET_USER_ID_BY_LOGIN(:IN_USER_LOGIN)
  		RETURNING_VALUES (:IN_USER_ID);
    END 
    
    IF ((IN_ATYPE_ID IS NULL) AND NOT (IN_USER_LOGIN IS NULL)) THEN 
    BEGIN
    	EXECUTE PROCEDURE GET_ATYPE_ID_BY_CODE(:IN_ATYPE_CODE)
  		RETURNING_VALUES (:IN_ATYPE_ID);
    END
    
    IF ((IN_REPORT_ID IS NULL) AND NOT (IN_REPORT_CODE IS NULL)) THEN 
    BEGIN
    	EXECUTE PROCEDURE GET_REPORT_ID_BY_CODE(:IN_REPORT_CODE)
  		RETURNING_VALUES (:IN_REPORT_ID);
    END
    
    IF ((IN_SERVICE_ID IS NULL) AND NOT (IN_SERVICE_CODE IS NULL)) THEN 
    BEGIN
    	EXECUTE PROCEDURE GET_SERVICE_ID_BY_CODE(:IN_SERVICE_CODE)
  		RETURNING_VALUES (:IN_SERVICE_ID);
    END
    
    IF (IN_ATSTAMP IS NULL) THEN
    BEGIN
    	IN_ATSTAMP = CURRENT_TIMESTAMP;
    END
    
    IF (NOT(IN_USER_ID IS NULL) AND NOT(IN_ATYPE_ID IS NULL)) THEN
    BEGIN
  		OUT_ACTION_ID=GEN_ID(ACTIONS_REGS_ACTIONS_ID_GEN, 1);
        INSERT INTO ACTIONS_REG(ACTIONS_ID, ACTOR_ID, ATYPE_ID,
        	SERVICE_ID, REPORT_ID, A_TSTAMP, DOC_ID, PERSON_ID,
            SERVICE_GROUP_ID)
        VALUES(:OUT_ACTION_ID, :IN_USER_ID, :IN_ATYPE_ID,
        	:IN_SERVICE_ID, :IN_REPORT_ID, :IN_ATSTAMP, 
            :IN_DOC_ID, :IN_PERSON_ID, :IN_SERVICE_GROUP_ID);
    
    	EXECUTE PROCEDURE GENERATE_DEFAULT_OP_ASSOCS(:OUT_ACTION_ID);    
    
    END
    
  END
  SUSPEND;
END^

