/* Definition for the `ADD_UPD_PERS_ELINK_REG` procedure :  */

SET TERM ^ ;

CREATE PROCEDURE ADD_UPD_PERS_ELINK_REG(
  IN_ELINK_ID INTEGER,
  IN_PERSON_ID INTEGER NOT NULL,
  IN_ELTYPE_ID INTEGER,
  IN_ELSTATUS_ID INTEGER,
  IN_ADRES_ID INTEGER,
  IN_DOC_ID INTEGER,
  IN_LINK_PERSON_ID INTEGER)
RETURNS(
  OUT_ELINK_ID SMALLINT)
AS
BEGIN
  /* Procedure body */
  IF (IN_ELINK_ID IS NULL) THEN
  BEGIN
  	IF (NOT (IN_PERSON_ID IS NULL)) THEN
 	 BEGIN
     
     	IF (IN_ADRES_ID=-1) THEN
        BEGIN
            EXECUTE PROCEDURE INSERT_BLANK_ADRES
  			RETURNING_VALUES (:IN_ADRES_ID);
        END
        
        IF (IN_DOC_ID=-1) THEN
        BEGIN
        	EXECUTE PROCEDURE INSERT_BLANK_DOC
  			RETURNING_VALUES (:IN_DOC_ID);
        END
        
        IF (IN_LINK_PERSON_ID=-1) THEN
        BEGIN
        	EXECUTE PROCEDURE INSERT_BLANK_PERSON
  			RETURNING_VALUES (:IN_LINK_PERSON_ID);
        END
        
     	OUT_ELINK_ID = GEN_ID(ENTLNK_REG_EL_REG_ID_GEN, 1);
  	 	INSERT INTO ENTLNK_REG(EL_REG_ID, EVENT_DATE, ENTLNK_TYPE_ID,
        	ESTATUS_ID, PERSON_ID, ADRES_ID, DOC_ID, LINK_PERSON_ID)
        	VALUES(:OUT_ELINK_ID, CURRENT_DATE, :IN_ELTYPE_ID, 
        	:IN_ELSTATUS_ID, :IN_PERSON_ID, :IN_ADRES_ID, 
            :IN_DOC_ID, :IN_LINK_PERSON_ID);
  	 END
  END
  SUSPEND;
END^

