/* Definition for the `ADRESES_VIEW` view :  */

CREATE VIEW ADRESES_VIEW(
  ADRES_ID,
  ADR_FULL_NAME,
  ADR_FULL_PART1,
  ADR_FULL_PART2,
  COUNTRY_NAME,
  STATE_NAME,
  DISTRICT_NAME,
  SETTLEM_NAME,
  STREET_NAME,
  HOUSE_NUM,
  CORPUS,
  LITER,
  APARTMENT_NUM,
  ITS_CITY,
  SHORT_NAME,
  SETTL_SHORTY_NAME,
  SETTL_SHORTY_ID,
  STATE_SHORTY)
AS
SELECT adr.ADRES_ID,
  (COALESCE(ctr.COUNTRY_NAME,'')||' '||COALESCE(stt.STATE_NAME,'')||
  ' '||COALESCE(dst.DISTRICT_NAME,'')||' '||
  COALESCE(stl.SETTLEM_NAME,'')||' '||
  COALESCE(' ул. '||adr.STREET_NAME,'')||
  COALESCE(' д.'||ADR.HOUSE_NUM,'')||
  COALESCE(' корп.'||ADR.CORPUS,'')||
  COALESCE(' кв.'||ADR.APARTMENT_NUM,'')||
  COALESCE(' литер '||ADR.LITER,'')) AS ADR_FULL_NAME,
  (COALESCE(ctr.COUNTRY_NAME,'')||' '||COALESCE(stt.STATE_NAME,'')) 
  AS ADR_FULL_PART1,
  (COALESCE(dst.DISTRICT_NAME,'')||' '||
  COALESCE(stl.SETTLEM_NAME,'')||' '||
  COALESCE(' ул. '||adr.STREET_NAME,'')||
  COALESCE(' д.'||ADR.HOUSE_NUM,'')||
  COALESCE(' корп.'||ADR.CORPUS,'')||
  COALESCE(' кв.'||ADR.APARTMENT_NUM,'')||
  COALESCE(' литер '||ADR.LITER,'')) AS ADR_FULL_PART2,
  ctr.COUNTRY_NAME,
  stt.STATE_NAME,
  dst.DISTRICT_NAME,
  stl.SETTLEM_NAME,
  adr.STREET_NAME,
  adr.HOUSE_NUM,
  adr.CORPUS,
  adr.LITER,
  adr.APARTMENT_NUM,
  stl.ITS_CITY,
  stl.SHORT_NAME,
  stl.KLADR_SHORTY AS SETTL_SHORTY_NAME,
  stl.SETTL_SHORTY_ID, 
  stt.KLADR_SHORTY AS STATE_SHORTY 
  FROM ADRESES adr LEFT JOIN COUNTRIES ctr 
  ON (adr.ADR_COUNTRY_ID=ctr.COUNTRY_ID) 
  LEFT JOIN STATES stt ON (adr.ADR_STATE_ID=stt.STATE_ID) 
  LEFT JOIN DISTRICTS dst ON (adr.ADR_REGION_ID=dst.DISTRICTS_ID) 
  LEFT JOIN SETTLEMENTS stl 
  ON (adr.ADR_SETTLEM_ID=stl.SETTLEMENT_ID);

