/* Definition for the `STATES_VIEW` view :  */

CREATE VIEW STATES_VIEW(
  STATE_NAME,
  KLADR_SHORTY,
  KLADR_CODE,
  KLADR_SHORTY1,
  KLADR_INDEX,
  STATE_INT_CODE,
  STATE_COUNTRY_ID,
  STATE_COUNTRY_NAME,
  SHORT_LEVEL,
  SHORT_INT_CODE,
  SHORT_TEXT,
  SHORT_FULL,
  STATE_SHORT,
  STATE_WITH_SHORT,
  STATE_WITH_FSHORT,
  STATE_FULL_NAME,
  STATE_ID)
AS
SELECT stt.STATE_NAME,
  stt.KLADR_SHORTY,
  STT.KLADR_CODE,
  stt.KLADR_SHORTY,
  STT.KLADR_INDEX,
  stt.STATE_INT_CODE,
  stt.STATE_COUNTRY_ID,
  cnt.COUNTRY_NAME as STATE_COUNTRY_NAME,
  shr.SHORT_LEVEL,
  shr.SHORT_INT_CODE,
  shr.SHORT_TEXT,
  shr.SHORT_FULL,
  COALESCE(shr.SHORT_TEXT, stt.KLADR_SHORTY) as STATE_SHORT,
  COALESCE(shr.SHORT_TEXT, stt.KLADR_SHORTY)||' '||stt.STATE_NAME as STATE_WITH_SHORT,
  COALESCE(shr.SHORT_FULL, COALESCE(shr.SHORT_TEXT, stt.KLADR_SHORTY))||' '||stt.STATE_NAME as STATE_WITH_FSHORT,
  stt.STATE_NAME||' '||COALESCE(shr.SHORT_FULL, COALESCE(shr.SHORT_TEXT, stt.KLADR_SHORTY))||COALESCE(' '||cnt.COUNTRY_NAME,'') AS STATE_FULL_NAME,
  stt.STATE_ID
  FROM STATES stt LEFT JOIN COUNTRIES cnt 
  ON (stt.STATE_COUNTRY_ID=cnt.COUNTRY_ID)
  LEFT JOIN SHORTED shr 
  ON (STT.STATE_SHORT_ID=shr.SHORT_ID);

/* Definition for the `DISTRICTS_VIEW` view :  */

CREATE VIEW DISTRICTS_VIEW(
  DISTRICTS_ID,
  DISTRICT_CODE,
  DISTRICT_NAME,
  DISTRICT_STATE_ID,
  DISTRICT_SHORT_ID,
  ITS_CITY_DISTRICT,
  KLADR_CODE,
  KLADR_INDEX,
  KLADR_SHORTY,
  STATE_WITH_FSHORT,
  SHORT_LEVEL,
  SHORT_TEXT,
  SHORT_FULL,
  DISTRICT_SHORT,
  DISTRICT_WITH_SHORT,
  DISTRICT_FULL_NAME)
AS
SELECT 
  dst.DISTRICTS_ID,
  dst.DISTRICT_CODE,
  dst.DISTRICT_NAME,
  dst.DISTRICT_STATE_ID,
  dst.DISTRICT_SHORT_ID,
  dst.ITS_CITY_DISTRICT,
  dst.KLADR_CODE,
  DST.KLADR_INDEX,
  dst.KLADR_SHORTY,
  stv.STATE_WITH_FSHORT,
  shr.SHORT_LEVEL,
  shr.SHORT_TEXT,
  shr.SHORT_FULL,
  COALESCE(shr.SHORT_TEXT, dst.KLADR_SHORTY) as DISTRICT_SHORT,
  dst.DISTRICT_NAME||' '||COALESCE(shr.SHORT_FULL,COALESCE(shr.SHORT_TEXT,dst.KLADR_SHORTY)) as DISTRICT_WITH_SHORT,
  dst.DISTRICT_NAME||' '||COALESCE(shr.SHORT_FULL,COALESCE(shr.SHORT_TEXT,dst.KLADR_SHORTY))||' '||COALESCE(STV.STATE_FULL_NAME,'') as DISTRICT_FULL_NAME
  FROM	DISTRICTS dst LEFT JOIN STATES_VIEW STV
  ON (dst.DISTRICT_STATE_ID=stv.STATE_ID)
  LEFT JOIN SHORTED SHR
  ON (DST.DISTRICT_SHORT_ID=shr.SHORT_ID);

