CREATE VIEW DOCS_VIEW(
  DOC_CREATE_DATE,
  DOC_ID,
  DOC_BRANCH_NAME,
  DOC_NUM,
  DOC_SERIE,
  DOC_EXPIRATION_DATE,
  IS_IDENTITY,
  POLICY_STATION_NAME,
  DOC_TYPE_NAME,
  DOC_TYPE_INT_CODE,
  DOC_FULL_NAME,
  DOC_BRANCHE_CODE,
  PLSTATUS_NAME,
  DOC_STATUS_ID)
AS
SELECT dc.DOC_CREATE_DATE,
  dc.DOC_ID,
  COALESCE (fms_br.BRANCHE_NAME,dc.DOC_BRANCH_NAME) AS DOC_BRANCH_NAME,
  dc.DOC_NUM,
  dc.DOC_SERIE,
  dc.DOC_EXPIRATION_DATE,
  dc.IS_IDENTITY,
  ps.STATION_NAME AS POLICY_STATION_NAME,
  dtp.DOC_TYPE_NAME,
  dtp.DOC_TYPE_INT_CODE,
  (COALESCE(dtp.DOC_TYPE_NAME,'')||' '||
  COALESCE(dc.DOC_SERIE,'')||COALESCE(' № '||dc.DOC_NUM,'')||
  COALESCE(' ОТ '||dc.DOC_CREATE_DATE,'')) AS DOC_FULL_NAME,
  COALESCE (FMS_BR.BRANCHE_CODE,dc.DOC_BRANCHE_CODE) AS DOC_BRANCHE_CODE,
  pls.PLSTATUS_NAME,
  dc.DOC_STATUS_ID
  FROM DOCS dc LEFT JOIN DOC_TYPES dtp 
  ON (dc.DOC_TYPE_ID=dtp.DOC_TYPE_ID)
  LEFT JOIN POLICY_STATIONS ps 
  ON (dc.DOC_POLICY_STATION_ID=ps.POLICY_STATION_ID)
  LEFT JOIN PLACE_STATUSES pls
  ON (dc.DOC_STATUS_ID=pls.PLACE_STATUS_ID)
  LEFT JOIN FMS_BRANCHES fms_br 
  ON (dc.DOC_BRANCH_ID=fms_br.BRANCHE_ID);

