/* Definition for the `GEN_DISTRICTS_LANGUAGE_CASES` procedure :  */

SET TERM ^ ;

CREATE PROCEDURE GEN_DISTRICTS_LANGUAGE_CASES
AS
DECLARE VARIABLE CURR_ENT_ID INTEGER;
DECLARE VARIABLE CURR_ENT_NAME VARCHAR(255);
DECLARE VARIABLE CURR_ENT_SHORT VARCHAR(50);
DECLARE VARIABLE NAME_GENITIVE VARCHAR(255);
BEGIN
  /* Procedure body */
  FOR SELECT DISTRICTS_ID, DISTRICT_NAME, DISTRICT_SHORT FROM DISTRICTS_VIEW 
  INTO :CURR_ENT_ID, :CURR_ENT_NAME, :CURR_ENT_SHORT DO
  BEGIN
  
  	IF (CURR_ENT_SHORT='р-н') THEN
    BEGIN 
    IF	(((RIGHT(CURR_ENT_NAME,3)='кий') OR
    	(RIGHT(CURR_ENT_NAME,3)='кой') OR
        (RIGHT(CURR_ENT_NAME,2)='ый') OR 
        (POSITION('кий ' IN CURR_ENT_NAME)>0) OR 
        (POSITION('кой ' IN CURR_ENT_NAME)>0) OR 
        (POSITION('ый ' IN CURR_ENT_NAME)>0)) AND 
        (CHAR_LENGTH(CURR_ENT_NAME)>3)) THEN
    BEGIN
    	IF (RIGHT(CURR_ENT_NAME,3)='кий') THEN
        BEGIN
    		NAME_GENITIVE=SUBSTRING(CURR_ENT_NAME FROM 1 FOR 
        		(CHAR_LENGTH(CURR_ENT_NAME)-3))||'кого Р-НА';
        END
        IF (RIGHT(CURR_ENT_NAME,3)='кой') THEN
        BEGIN
    		NAME_GENITIVE=SUBSTRING(CURR_ENT_NAME FROM 1 FOR 
        		(CHAR_LENGTH(CURR_ENT_NAME)-3))||'кого Р-НА';
        END
        IF (RIGHT(CURR_ENT_NAME,2)='ый') THEN
        BEGIN
    		NAME_GENITIVE=SUBSTRING(CURR_ENT_NAME FROM 1 FOR 
        		(CHAR_LENGTH(CURR_ENT_NAME)-2))||'ого Р-НА';
        END
        NAME_GENITIVE=REPLACE(NAME_GENITIVE,'кий ','кого ');
        NAME_GENITIVE=REPLACE(NAME_GENITIVE,'кой ','кого ');
        NAME_GENITIVE=REPLACE(NAME_GENITIVE,'ый ','ого ');
        UPDATE DISTRICTS SET DISTRICT_GENITIVE_CASE=:NAME_GENITIVE
        WHERE DISTRICTS_ID=:CURR_ENT_ID AND ((DISTRICT_GENITIVE_CASE IS NULL) 
        OR (DISTRICT_GENITIVE_CASE=''));	
    END
    ELSE
    BEGIN
    	NAME_GENITIVE='Р-НА '||CURR_ENT_NAME;
