CREATE PROCEDURE GEN_STATES_LANGUAGE_CASES
AS
DECLARE VARIABLE CURR_ENT_ID INTEGER;
DECLARE VARIABLE CURR_ENT_NAME VARCHAR(255);
DECLARE VARIABLE CURR_ENT_SHORT VARCHAR(50);
DECLARE VARIABLE NAME_GENITIVE VARCHAR(255);
BEGIN
  /* Procedure body */
  FOR SELECT STATE_ID, STATE_NAME, STATE_SHORT FROM STATES_VIEW 
  INTO :CURR_ENT_ID, :CURR_ENT_NAME, :CURR_ENT_SHORT DO
  BEGIN
  
  	IF ((CURR_ENT_SHORT='АО') AND 
    	((RIGHT(CURR_ENT_NAME,3)='кий') OR 
        (POSITION('кий ' IN CURR_ENT_NAME)>0)) AND 
        (CHAR_LENGTH(CURR_ENT_NAME)>3)) THEN
    BEGIN
    	IF (RIGHT(CURR_ENT_NAME,3)='кий') THEN
        BEGIN
    		NAME_GENITIVE=SUBSTRING(CURR_ENT_NAME FROM 1 FOR 
        		(CHAR_LENGTH(CURR_ENT_NAME)-3))||'кого АО';
        END
        NAME_GENITIVE=REPLACE(NAME_GENITIVE,'кий ','кого ');
        UPDATE STATES SET STATE_GENITIVE_CASE=:NAME_GENITIVE
        WHERE STATE_ID=:CURR_ENT_ID AND ((STATE_GENITIVE_CASE IS NULL) 
        OR (STATE_GENITIVE_CASE=''));	
    END
    
    IF (CURR_ENT_SHORT='г')  THEN
    BEGIN
    	NAME_GENITIVE='г '||CURR_ENT_NAME;
        UPDATE STATES SET STATE_GENITIVE_CASE=:NAME_GENITIVE
        WHERE STATE_ID=:CURR_ENT_ID AND ((STATE_GENITIVE_CASE IS NULL) 
        OR (STATE_GENITIVE_CASE=''));	
    END
    
    IF ((CURR_ENT_SHORT='Аобл') AND 
    	((RIGHT(CURR_ENT_NAME,3)='кая') OR 
        (POSITION('кая ' IN CURR_ENT_NAME)>0)) AND 
        (CHAR_LENGTH(CURR_ENT_NAME)>3)) THEN
    BEGIN
    	IF (RIGHT(CURR_ENT_NAME,3)='кая') THEN
        BEGIN
        NAME_GENITIVE=SUBSTRING(CURR_ENT_NAME FROM 1 FOR 
        	(CHAR_LENGTH(CURR_ENT_NAME)-3))||'кой АОбл';
        END
        NAME_GENITIVE=REPLACE(NAME_GENITIVE,'кая ','кой ');
        UPDATE STATES SET STATE_GENITIVE_CASE=:NAME_GENITIVE
        WHERE STATE_ID=:CURR_ENT_ID AND ((STATE_GENITIVE_CASE IS NULL) 
        OR (STATE_GENITIVE_CASE=''));	
    END
    
    IF ((CURR_ENT_SHORT='Респ') AND (CHAR_LENGTH(CURR_ENT_NAME)>3)) THEN
    BEGIN
    IF((RIGHT(CURR_ENT_NAME,3)='кая') OR 
        (POSITION('кая ' IN CURR_ENT_NAME)>0))  
         THEN
    BEGIN
    	IF (RIGHT(CURR_ENT_NAME,3)='кая') THEN
        BEGIN
        NAME_GENITIVE=SUBSTRING(CURR_ENT_NAME FROM 1 FOR 
        	(CHAR_LENGTH(CURR_ENT_NAME)-3))||'кой Респ';
        END
        NAME_GENITIVE=REPLACE(NAME_GENITIVE,'кая ','кой ');
        UPDATE STATES SET STATE_GENITIVE_CASE=:NAME_GENITIVE
        WHERE STATE_ID=:CURR_ENT_ID AND ((STATE_GENITIVE_CASE IS NULL) 
        OR (STATE_GENITIVE_CASE=''));	
    END	
    ELSE
    BEGIN
    	 UPDATE STATES SET STATE_GENITIVE_CASE='Респ '||:CURR_ENT_NAME
        WHERE STATE_ID=:CURR_ENT_ID AND ((STATE_GENITIVE_CASE IS NULL) 
        OR (STATE_GENITIVE_CASE=''));	
    END
    END
    
    IF ((CURR_ENT_SHORT='край') AND 
    	((RIGHT(CURR_ENT_NAME,3)='кий') OR 
        (POSITION('кий ' IN CURR_ENT_NAME)>0)) AND 
        (CHAR_LENGTH(CURR_ENT_NAME)>3)) THEN
    BEGIN
    	IF (RIGHT(CURR_ENT_NAME,3)='кий') THEN
        BEGIN
    		NAME_GENITIVE=SUBSTRING(CURR_ENT_NAME FROM 1 FOR 
        		(CHAR_LENGTH(CURR_ENT_NAME)-3))||'кого края';
        END
        NAME_GENITIVE=REPLACE(NAME_GENITIVE,'кий ','кого ');
        UPDATE STATES SET STATE_GENITIVE_CASE=:NAME_GENITIVE
        WHERE STATE_ID=:CURR_ENT_ID AND ((STATE_GENITIVE_CASE IS NULL) 
        OR (STATE_GENITIVE_CASE=''));	
    END
    
    IF ((CURR_ENT_SHORT='обл') AND 
    	((RIGHT(CURR_ENT_NAME,3)='кая') OR 
        (POSITION('кая ' IN CURR_ENT_NAME)>0)) AND 
        (CHAR_LENGTH(CURR_ENT_NAME)>3)) THEN
    BEGIN
    	IF (RIGHT(CURR_ENT_NAME,3)='кая') THEN
        BEGIN
        NAME_GENITIVE=SUBSTRING(CURR_ENT_NAME FROM 1 FOR 
        	(CHAR_LENGTH(CURR_ENT_NAME)-3))||'кой обл';
        END
        NAME_GENITIVE=REPLACE(NAME_GENITIVE,'кая ','кой ');
        UPDATE STATES SET STATE_GENITIVE_CASE=:NAME_GENITIVE
        WHERE STATE_ID=:CURR_ENT_ID AND ((STATE_GENITIVE_CASE IS NULL) 
        OR (STATE_GENITIVE_CASE=''));	
    END
    
    IF ((CURR_ENT_SHORT='округ') AND 
    	((RIGHT(CURR_ENT_NAME,3)='кий') OR 
        (POSITION('кий ' IN CURR_ENT_NAME)>0)) AND 
        (CHAR_LENGTH(CURR_ENT_NAME)>3)) THEN
    BEGIN
    	IF (RIGHT(CURR_ENT_NAME,3)='кий') THEN
        BEGIN
    		NAME_GENITIVE=SUBSTRING(CURR_ENT_NAME FROM 1 FOR 
        		(CHAR_LENGTH(CURR_ENT_NAME)-3))||'кого округа';
        END
        NAME_GENITIVE=REPLACE(NAME_GENITIVE,'кий ','кого ');
        NAME_GENITIVE=REPLACE(NAME_GENITIVE,'кая ','кой ');
        NAME_GENITIVE=REPLACE(NAME_GENITIVE,'край ','края ');
        UPDATE STATES SET STATE_GENITIVE_CASE=:NAME_GENITIVE
        WHERE STATE_ID=:CURR_ENT_ID AND ((STATE_GENITIVE_CASE IS NULL) 
        OR (STATE_GENITIVE_CASE=''));	
    END
    
  END
  SUSPEND;
END^

