/* Definition for the `GET_SHORT_ID_BY_NAME_STATUS_EXT` procedure :  */

SET TERM ^ ;

CREATE PROCEDURE GET_SHORT_ID_BY_NAME_STATUS_EXT(
  IN_SHORT_NAME VARCHAR(50) CHARACTER SET UTF8 COLLATE UTF8,
  IN_STATUS INTEGER,
  IN_KLADR_CODE VARCHAR(20) CHARACTER SET UTF8 COLLATE UTF8)
RETURNS(
  OUT_SHORT_ID INTEGER,
  OUT_SHORT_LEVEL INTEGER)
AS
DECLARE VARIABLE SHORT_NCOUNT INTEGER;
DECLARE VARIABLE CURR_SHORT_ID INTEGER;
DECLARE VARIABLE CURR_SHORT_LEVEL INTEGER;
DECLARE VARIABLE OKATO_FIRST_SEGM VARCHAR(2);
DECLARE VARIABLE OKATO_TWO_SEGM VARCHAR(3);
DECLARE VARIABLE OKATO_THREE_SEGM VARCHAR(3);
DECLARE VARIABLE OKATO_FOUR_SEGM VARCHAR(3);
BEGIN
  /* Procedure body */
  
  OUT_SHORT_ID=NULL;
  OUT_SHORT_LEVEL=NULL;
  IF (IN_STATUS IS NULL) THEN
  BEGIN
  	IN_STATUS=0;
  END
  IF (NOT (IN_SHORT_NAME IS NULL)) THEN
  BEGIN
  	IF (IN_SHORT_NAME<>'') THEN
  	BEGIN
    	SHORT_NCOUNT=0;
        OUT_SHORT_ID=NULL;
        SELECT COUNT(SHORT_ID) FROM
        SHORTED WHERE SHORT_TEXT=:IN_SHORT_NAME
        INTO :SHORT_NCOUNT;
    
  		IF (SHORT_NCOUNT>0) THEN
        BEGIN
        	IF (SHORT_NCOUNT=1) THEN
        	BEGIN
        		SELECT SHORT_ID, SHORT_LEVEL FROM SHORTED 
  				WHERE SHORT_TEXT=:IN_SHORT_NAME 
  				INTO :OUT_SHORT_ID, :OUT_SHORT_LEVEL;
        	END
            ELSE
            BEGIN
            
                CURR_SHORT_ID=NULL;
                CURR_SHORT_LEVEL=NULL;
                
            	FOR SELECT SHORT_ID, SHORT_LEVEL FROM SHORTED 
  				WHERE SHORT_TEXT=:IN_SHORT_NAME 
                ORDER BY SHORT_LEVEL DESC
  				INTO :CURR_SHORT_ID, :CURR_SHORT_LEVEL
                DO
                BEGIN
                	IF (NOT (IN_STATUS IS NULL)) THEN
                    BEGIN	
                    	IF (IN_STATUS=0) THEN
                    	BEGIN
                        	IN_STATUS=NULL;
                    		OUT_SHORT_ID=CURR_SHORT_ID;
                        	OUT_SHORT_LEVEL=CURR_SHORT_LEVEL;
                    	END
                    	IF (IN_STATUS>0) THEN
                    	BEGIN
                      		IN_STATUS=IN_STATUS-1;		
                    	END
                    END
                END
                
                IF ((OUT_SHORT_ID IS NULL) AND NOT (CURR_SHORT_ID IS NULL)) THEN
                BEGIN
                	OUT_SHORT_ID=CURR_SHORT_ID;
                    OUT_SHORT_LEVEL=CURR_SHORT_LEVEL;
                END
                
            END
        END
  	END
  END
  
  IF (NOT (IN_KLADR_CODE IS NULL)) THEN
  BEGIN
  
  	IF (OUT_SHORT_LEVEL IS NULL) THEN
    BEGIN
      OUT_SHORT_LEVEL=5;	
    END
    
  	IF (CHAR_LENGTH(:IN_KLADR_CODE)>=11) THEN
    BEGIN
    	OKATO_FIRST_SEGM = SUBSTRING(:IN_KLADR_CODE FROM 1 FOR 2);
        OKATO_TWO_SEGM = SUBSTRING(:IN_KLADR_CODE FROM 3 FOR 3);
        OKATO_THREE_SEGM = SUBSTRING(:IN_KLADR_CODE FROM 6 FOR 3);
        OKATO_FOUR_SEGM = SUBSTRING(:IN_KLADR_CODE FROM 9 FOR 3);
        
        IF ((OKATO_FOUR_SEGM='000') AND (OUT_SHORT_LEVEL>3)) THEN
        BEGIN
        	OUT_SHORT_LEVEL=3;	
        END
        IF ((OKATO_THREE_SEGM='000') AND (OUT_SHORT_LEVEL>2)) THEN
        BEGIN
        	OUT_SHORT_LEVEL=2;	
        END
        IF ((OKATO_TWO_SEGM='000') AND (OUT_SHORT_LEVEL>1)) THEN
        BEGIN
        	OUT_SHORT_LEVEL=1;	
        END
        
        IF ((OKATO_TWO_SEGM<>'000') AND (OUT_SHORT_LEVEL<2)) THEN
        BEGIN
        	OUT_SHORT_LEVEL=2;	
        END
        IF ((OKATO_THREE_SEGM<>'000') AND (OUT_SHORT_LEVEL<3)) THEN
        BEGIN
        	OUT_SHORT_LEVEL=3;	
        END
        IF ((OKATO_FOUR_SEGM<>'000') AND (OUT_SHORT_LEVEL<5)) THEN
        BEGIN
        	OUT_SHORT_LEVEL=5;	
        END
        
    END
  END
  
  SUSPEND;
END^

