CREATE PROCEDURE IMPORT_KLADR_ITEM(
  IN_ITEM_NAME VARCHAR(255) CHARACTER SET UTF8 COLLATE UTF8,
  IN_SHORTY_NAME VARCHAR(50) CHARACTER SET UTF8 COLLATE UTF8,
  IN_KLADR_CODE VARCHAR(20) CHARACTER SET UTF8 COLLATE UTF8,
  IN_INDEX VARCHAR(10) CHARACTER SET UTF8 COLLATE UTF8,
  IN_GNIMB VARCHAR(5) CHARACTER SET UTF8 COLLATE UTF8,
  IN_UNO VARCHAR(20) CHARACTER SET UTF8 COLLATE UTF8,
  IN_OCATD VARCHAR(15) CHARACTER SET UTF8 COLLATE UTF8,
  IN_STATUS INTEGER,
  MIN_LEVEL INTEGER,
  MAX_LEVEL INTEGER)
RETURNS(
  OUT_KLADR_ID INTEGER,
  OUT_SHORT_ID INTEGER,
  OUT_SHORT_LEVEL INTEGER)
AS
BEGIN
  /* Procedure body */
        		INSERT INTO KLADR(KLADR_ID, KLADR_NAME, KLADR_SHORTY,
                KLADR_CODE, KLADR_INDEX, KLADR_GNIMB, KLADR_UNO,
                KLADR_OCATD, KLADR_STATUS, KLADR_SHORT_ID)
                VALUES(NULL, 'test', 'test',
                NULL, NULL, NULL, NULL,
                NULL, CAST(0 AS VARCHAR(20)), 0);
  IF (NOT ((IN_ITEM_NAME IS NULL) OR (IN_SHORTY_NAME IS NULL))) THEN
  BEGIN
  	IF (NOT ((IN_ITEM_NAME='') OR (IN_SHORTY_NAME=''))) THEN
    BEGIN
    	OUT_SHORT_ID=NULL;
    	EXECUTE PROCEDURE GET_SHORT_ID_BY_NAME_STATUS(
        :IN_SHORTY_NAME, :IN_STATUS) 
        RETURNING_VALUES (:OUT_SHORT_ID, :OUT_SHORT_LEVEL);
        IF (OUT_SHORT_ID IS NULL) THEN
        BEGIN
            OUT_SHORT_LEVEL=10; 
        	EXECUTE PROCEDURE ADD_UPD_SHORTED(NULL, 10, :IN_SHORTY_NAME,
            NULL, NULL) RETURNING_VALUES (:OUT_SHORT_ID);
        END
        IF (NOT (OUT_SHORT_ID IS NULL) OR (1=1)) THEN
        BEGIN
        	
            IF (OUT_SHORT_LEVEL IS NULL) THEN
            BEGIN
            	OUT_SHORT_LEVEL=10;
            END
            
            IF (OUT_SHORT_LEVEL<1) THEN
            BEGIN
            	OUT_SHORT_LEVEL=10;
            END
            
            IF ((OUT_SHORT_LEVEL>=0) AND (OUT_SHORT_LEVEL<=100)) THEN
            BEGIN
            
            IF (OUT_SHORT_LEVEL>=5) THEN
            BEGIN
            	OUT_KLADR_ID = GEN_ID(KLADR_KLADR_ID_GEN, 1);
        		INSERT INTO KLADR(KLADR_ID, KLADR_NAME, KLADR_SHORTY,
                KLADR_CODE, KLADR_INDEX, KLADR_GNIMB, KLADR_UNO,
                KLADR_OCATD, KLADR_STATUS, KLADR_SHORT_ID)
                VALUES(:OUT_KLADR_ID, :IN_ITEM_NAME, :IN_SHORTY_NAME,
                :IN_KLADR_CODE, :IN_INDEX, :IN_GNIMB, :IN_UNO,
                :IN_OCATD, CAST(:IN_STATUS AS VARCHAR(20)), :OUT_SHORT_ID);
            END
            
            IF (OUT_SHORT_LEVEL=4) THEN
            BEGIN
            	EXECUTE PROCEDURE ADD_UPDATE_SETTLEMENT_EXT(NULL,
                :IN_ITEM_NAME, NULL, NULL, 0, :OUT_SHORT_ID,
                :IN_SHORTY_NAME, :IN_KLADR_CODE, :IN_INDEX, :IN_GNIMB,
                :IN_UNO, :IN_OCATD, CAST(:IN_STATUS AS VARCHAR(20)))
                RETURNING_VALUES (:OUT_KLADR_ID);
            END
            
            IF (OUT_SHORT_LEVEL=3) THEN
            BEGIN
            	EXECUTE PROCEDURE ADD_UPDATE_SETTLEMENT_EXT(NULL,
                :IN_ITEM_NAME, NULL, NULL, 1, :OUT_SHORT_ID,
                :IN_SHORTY_NAME, :IN_KLADR_CODE, :IN_INDEX, :IN_GNIMB,
                :IN_UNO, :IN_OCATD, CAST(:IN_STATUS AS VARCHAR(20)))
                RETURNING_VALUES (:OUT_KLADR_ID);
            END
            
            IF (OUT_SHORT_LEVEL=2) THEN
            BEGIN
            	EXECUTE PROCEDURE ADD_UPDATE_DISTRICT_EXT(NULL,
                :IN_ITEM_NAME, :IN_KLADR_CODE, NULL, NULL, 0, :OUT_SHORT_ID,
                :IN_SHORTY_NAME, :IN_KLADR_CODE, :IN_INDEX, :IN_GNIMB,
                :IN_UNO, :IN_OCATD, CAST(:IN_STATUS AS VARCHAR(20)))
                RETURNING_VALUES (:OUT_KLADR_ID);
            END
            
            IF (OUT_SHORT_LEVEL=1) THEN
            BEGIN
            	EXECUTE PROCEDURE ADD_UPDATE_STATE_EXT(NULL,
                :IN_ITEM_NAME, :IN_KLADR_CODE, NULL, :OUT_SHORT_ID,
                :IN_SHORTY_NAME, :IN_KLADR_CODE, :IN_INDEX, :IN_GNIMB,
                :IN_UNO, :IN_OCATD, CAST(:IN_STATUS AS VARCHAR(20)))
                RETURNING_VALUES (:OUT_KLADR_ID);
            END
            
            END
            
        END 
    END
  END
  SUSPEND;
END^

