/* Definition for the `LINK_IMPORT_KLADR_ITEMS` procedure :  */

SET TERM ^ ;

CREATE PROCEDURE LINK_IMPORT_KLADR_ITEMS
AS
DECLARE VARIABLE CURR_DISTR_CODE VARCHAR(5);
DECLARE VARIABLE CURR_DISTR_ID INTEGER;
DECLARE VARIABLE CURR_STATE_CODE VARCHAR(2);
DECLARE VARIABLE CURR_STATE_ID INTEGER;
BEGIN
  /* Procedure body */
  FOR SELECT SUBSTRING(KLADR_CODE FROM 1 FOR 5), DISTRICTS_ID 
  FROM DISTRICTS WHERE (CHAR_LENGTH(KLADR_CODE)>=11)
  INTO :CURR_DISTR_CODE, :CURR_DISTR_ID DO
  BEGIN
  	UPDATE SETTLEMENTS SET 
  	SETTL_DISTRICT_ID=:CURR_DISTR_ID 
  	WHERE SUBSTRING(KLADR_CODE FROM 1 FOR 5)=:CURR_DISTR_CODE;
  END
  
  FOR SELECT SUBSTRING(KLADR_CODE FROM 1 FOR 2), STATE_ID 
  FROM STATES WHERE (CHAR_LENGTH(KLADR_CODE)>=11)
  INTO :CURR_STATE_CODE, :CURR_STATE_ID DO
  BEGIN
  	UPDATE SETTLEMENTS SET 
  	SETTL_STATE_ID=:CURR_STATE_ID 
  	WHERE SUBSTRING(KLADR_CODE FROM 1 FOR 2)=:CURR_STATE_CODE;
    UPDATE DISTRICTS SET 
  	DISTRICT_STATE_ID=:CURR_STATE_ID 
  	WHERE SUBSTRING(KLADR_CODE FROM 1 FOR 2)=:CURR_STATE_CODE;
  END
  	
  SUSPEND;
END^

