CREATE VIEW OP_ADR_DATA(
  AEL_AS_ID,
  ACT_REG_ID,
  ELINK_ID,
  AEL_LINK_TYPE_ID,
  ELINK_TYPE,
  ADR_FULL_PART1,
  ADR_FULL_PART2,
  ADR_FULL_NAME,
  PARAM_NAME,
  COUNTRY_NAME,
  STATE_NAME,
  DISTRICT_NAME,
  SETTLEM_NAME,
  STREET_NAME,
  HOUSE_NUM,
  CORPUS,
  LITER,
  APARTMENT_NUM,
  ITS_CITY,
  SETTL_SHORTY_NAME,
  STATE_SHORTY,
  ELINK_CODE,
  ELINK_NAME,
  ADR_ECODE)
AS
select ael.AEL_AS_ID, ael.ACT_REG_ID,
ael.ELINK_ID, ael.AEL_LINK_TYPE_ID, enl.ELINK_TYPE,
adv.ADR_FULL_PART1, adv.ADR_FULL_PART2,
adv.ADR_FULL_NAME, enl.ELINK_NAME AS PARAM_NAME,
adv.COUNTRY_NAME, adv.STATE_NAME, adv.DISTRICT_NAME,
adv.SETTLEM_NAME, adv.STREET_NAME, 
adv.HOUSE_NUM, adv.CORPUS, adv.LITER, 
adv.APARTMENT_NUM,
ADV.ITS_CITY,
adv.SETTL_SHORTY_NAME,
adv.STATE_SHORTY,
enl.ELINK_CODE,
enl.ELINK_NAME,
ADR_ELN.ELINK_CODE as ADR_ECODE
from AEL_ASSOC ael LEFT JOIN ENTLINKS enl 
ON (ael.AEL_LINK_TYPE_ID=enl.ELINK_ID)
LEFT JOIN  ENTLNK_REG elr 
ON (ael.ELINK_ID=elr.EL_REG_ID)
LEFT JOIN  ADRESES_VIEW adv
ON (elr.ADRES_ID=adv.ADRES_ID)
LEFT JOIN ENTLINKS ADR_ELN
ON (elr.ENTLNK_TYPE_ID=ADR_ELN.ELINK_ID)
WHERE ENL.ELINK_TYPE=3;

