CREATE VIEW OP_DOC_DATA(
  AEL_AS_ID,
  ACT_REG_ID,
  ELINK_ID,
  AEL_LINK_TYPE_ID,
  ELINK_TYPE,
  DOC_FULL_NAME,
  PARAM_NAME,
  DOC_CREATE_DATE,
  DOC_BRANCH_NAME,
  DOC_NUM,
  DOC_SERIE,
  DOC_TYPE_NAME,
  POLICY_STATION_NAME,
  DOC_BRANCHE_CODE,
  ELINK_CODE,
  ELINK_NAME)
AS
select ael.AEL_AS_ID, ael.ACT_REG_ID,
ael.ELINK_ID, ael.AEL_LINK_TYPE_ID, enl.ELINK_TYPE,
docv.DOC_FULL_NAME, enl.ELINK_NAME AS PARAM_NAME,
docv.DOC_CREATE_DATE, docv.DOC_BRANCH_NAME,
docv.DOC_NUM, docv.DOC_SERIE, 
docv.DOC_TYPE_NAME, docv.POLICY_STATION_NAME,
docv.DOC_BRANCHE_CODE, enl.ELINK_CODE,
enl.ELINK_NAME 
from AEL_ASSOC ael LEFT JOIN ENTLINKS enl 
ON (ael.AEL_LINK_TYPE_ID=enl.ELINK_ID)
LEFT JOIN  ENTLNK_REG elr 
ON (ael.ELINK_ID=elr.EL_REG_ID)
LEFT JOIN  DOCS_VIEW docv
ON (elr.DOC_ID=docv.DOC_ID)
  WHERE ENL.ELINK_TYPE=4;

/* Definition for the `PERSON_VIEW` view :  */

CREATE VIEW PERSON_VIEW(
  PERSON_ID,
  PERSON_SEX_ID,
  FIRST_NAME,
  LAST_NAME,
  SURNAME,
  BIRTHDATE,
  PERSON_NAME,
  BULDING_TYPE_NAME)
AS
SELECT 
  pr.PERSON_ID,
  pr.PERSON_SEX_ID,
  pr.FIRST_NAME,
  pr.LAST_NAME,
  pr.SURNAME,
  PR.BIRTHDATE,
  COALESCE(PR.LAST_NAME||' ','')||
  COALESCE(PR.FIRST_NAME||' ','')||
  COALESCE(PR.SURNAME||' ','')||
  COALESCE(COU.COUNTRY_NAME||' ','')||
  COALESCE(PR.BIRTHDATE||' г.р. ','') AS PERSON_NAME,
  btp.BULDING_TYPE_NAME FROM
  PERSONS pr LEFT JOIN BUILDING_TYPES btp
  ON (pr.PERSON_BUILDING_ID=btp.BUILDING_TYPE_ID)
  LEFT JOIN COUNTRIES cou 
  ON (pr.PERSON_COUNTRY_ID=cou.COUNTRY_ID);

