/* Definition for the `PERSON_VIEW_DETAIL` view :  */

CREATE VIEW PERSON_VIEW_DETAIL(
  PERSON_ID,
  PERSON_SEX_ID,
  FIRST_NAME,
  LAST_NAME,
  SURNAME,
  BIRTHDATE,
  PERSON_NAME,
  BULDING_TYPE_NAME,
  SEX_NAME,
  COUNTRY_NAME,
  REGION_NAME,
  DISTRICT_NAME,
  ITS_CITY,
  SETTLEM_NAME,
  BIRTH_COUNTRY_ID,
  SEC_COUNTRY_ID,
  BIRTH_COUNT,
  SEC_COUNTRY,
  NATION_NAME,
  REGION_GENITIVE_CASE)
AS
SELECT 
  pr.PERSON_ID,
  pr.PERSON_SEX_ID,
  pr.FIRST_NAME,
  pr.LAST_NAME,
  pr.SURNAME,
  PR.BIRTHDATE,
  COALESCE(PR.LAST_NAME||' ','')||
  COALESCE(PR.FIRST_NAME||' ','')||
  COALESCE(PR.SURNAME||' ','')||
  COALESCE(COU.COUNTRY_NAME||' ','')||
  COALESCE(PR.BIRTHDATE||' г.р. ','') AS PERSON_NAME,
  btp.BULDING_TYPE_NAME,
  sx.SEX_NAME,
  COU.COUNTRY_NAME,
  RGN.REGION_NAME,
  dst.DISTRICT_NAME,
  stl.ITS_CITY,
  stl.SETTLEM_NAME,
  PR.BIRTH_COUNTRY_ID,
  pr.SEC_COUNTRY_ID,
  bco.COUNTRY_NAME AS BIRTH_COUNTRY,
  sco.COUNTRY_NAME AS SEC_COUNTRY,
  ntn.NATION_NAME,
  RGN.REGION_GENITIVE_CASE  
  FROM
  PERSONS pr LEFT JOIN BUILDING_TYPES btp
  ON (pr.PERSON_BUILDING_ID=btp.BUILDING_TYPE_ID)
  LEFT JOIN COUNTRIES cou 
  ON (pr.PERSON_COUNTRY_ID=cou.COUNTRY_ID) 
  LEFT JOIN SEXS SX
  ON (PR.PERSON_SEX_ID=sx.SEX_ID)
  LEFT JOIN REGIONS RGN
  ON (PR.BIRTH_REGION_ID=RGN.REGION_ID)
  LEFT JOIN DISTRICTS dst
  ON (PR.BIRTH_DISTRICT_ID=dst.DISTRICTS_ID)
  LEFT JOIN SETTLEMENTS stl
  ON (PR.BIRTH_SETTLEM_ID=stl.SETTLEMENT_ID)
  LEFT JOIN COUNTRIES bco 
  ON (pr.BIRTH_COUNTRY_ID=bco.COUNTRY_ID)
  LEFT JOIN COUNTRIES sco 
  ON (pr.SEC_COUNTRY_ID=sco.COUNTRY_ID)
  LEFT JOIN NATIONS NTN 
  ON (PR.PERSONS_NATION_ID=NTN.NATION_ID);

