 SELECT 
  gsrv.SERVICE_ID,
  gsrv.SERVICE_NAME,
  gsrv.SERVICE_CODE,
  gsrv.ITS_GROUP,
  gsrv.SERVICE_PRICE,
  gsrv.SERVICE_ID as PARENT_SERVICE_ID,
  gsrv.SERVICE_NAME as PARENT_SERVICE_NAME,
  gsrv.SERVICE_CODE as PARENT_SERVICE_CODE 
